import React, { useState, useEffect } from "react";
import axios from "axios";
import { Search, PlusCircle, Filter, MoreVertical } from "lucide-react";

const OrderStock = () => {
  const [orders, setOrders] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");

  useEffect(() => {
    fetchOrders();
  }, []);

  const fetchOrders = async () => {
    try {
      const response = await axios.get("http://localhost:5000/orders");
      setOrders(response.data);
    } catch (error) {
      console.error("Error fetching orders:", error);
    }
  };

  const filteredOrders = orders.filter((order) =>
    order.customer.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Sidebar + Header */}
      <div className="flex">
        {/* Sidebar */}
        <div className="w-64 bg-white shadow-lg">
          <div className="p-5">
            <h1 className="text-xl font-bold text-purple-600">ShopZen</h1>
            <nav className="mt-5 space-y-4">
              <a
                href="#"
                className="flex items-center px-4 py-2 bg-purple-100 text-purple-600 rounded-lg"
              >
                <span className="text-sm font-medium">Orders</span>
              </a>
              <a href="#" className="flex items-center px-4 py-2 hover:bg-gray-100">
                <span className="text-sm font-medium">Products</span>
              </a>
              {/* Add other menu links */}
            </nav>
          </div>
        </div>

        {/* Main Content */}
        <div className="flex-1 p-6">
          {/* Header */}
          <div className="flex items-center justify-between">
            <h1 className="text-2xl font-bold text-gray-800">Orders</h1>
            <button className="bg-purple-600 text-white px-4 py-2 rounded-lg flex items-center">
              <PlusCircle className="mr-2" size={18} />
              Create Order
            </button>
          </div>

          {/* Stats Overview */}
          <div className="grid grid-cols-4 gap-4 my-6">
            <div className="p-4 bg-white shadow rounded-lg">
              <h2 className="text-sm text-gray-500">Total Orders</h2>
              <p className="text-2xl font-bold">21</p>
              <p className="text-sm text-green-500">+25.2% last week</p>
            </div>
            <div className="p-4 bg-white shadow rounded-lg">
              <h2 className="text-sm text-gray-500">Order Items Over Time</h2>
              <p className="text-2xl font-bold">15</p>
              <p className="text-sm text-green-500">+18.2% last week</p>
            </div>
            <div className="p-4 bg-white shadow rounded-lg">
              <h2 className="text-sm text-gray-500">Return Orders</h2>
              <p className="text-2xl font-bold">0</p>
              <p className="text-sm text-red-500">-1.2% last week</p>
            </div>
            <div className="p-4 bg-white shadow rounded-lg">
              <h2 className="text-sm text-gray-500">Fulfilled Orders</h2>
              <p className="text-2xl font-bold">12</p>
              <p className="text-sm text-green-500">+12.2% last week</p>
            </div>
          </div>

          {/* Search and Filters */}
          <div className="flex justify-between items-center mb-4">
            <div className="relative">
              <Search className="absolute top-2.5 left-3 text-gray-400" size={20} />
              <input
                type="text"
                placeholder="Search customer"
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="pl-10 pr-4 py-2 border rounded-lg w-80"
              />
            </div>
            <div className="flex space-x-2">
              <button className="bg-gray-100 px-4 py-2 rounded-lg flex items-center">
                <Filter className="mr-2" size={16} />
                Filter
              </button>
              <button className="bg-gray-100 px-4 py-2 rounded-lg flex items-center">
                <MoreVertical size={16} />
              </button>
            </div>
          </div>

          {/* Orders Table */}
          <div className="overflow-hidden rounded-lg shadow bg-white">
            <table className="w-full table-auto">
              <thead className="bg-gray-100 text-gray-600 text-sm uppercase">
                <tr>
                  <th className="px-4 py-2 text-left">Order</th>
                  <th className="px-4 py-2 text-left">Date</th>
                  <th className="px-4 py-2 text-left">Customer</th>
                  <th className="px-4 py-2 text-left">Payment</th>
                  <th className="px-4 py-2 text-left">Total</th>
                  <th className="px-4 py-2 text-left">Items</th>
                  <th className="px-4 py-2 text-left">Fulfillment</th>
                  <th className="px-4 py-2 text-center">Actions</th>
                </tr>
              </thead>
              <tbody>
                {filteredOrders.map((order, index) => (
                  <tr key={index} className="border-b">
                    <td className="px-4 py-2">#{order.orderNumber}</td>
                    <td className="px-4 py-2">{order.date}</td>
                    <td className="px-4 py-2">{order.customer}</td>
                    <td className="px-4 py-2">
                      <span
                        className={`px-2 py-1 rounded-lg text-xs ${
                          order.paymentStatus === "Pending"
                            ? "bg-yellow-100 text-yellow-600"
                            : "bg-green-100 text-green-600"
                        }`}
                      >
                        {order.paymentStatus}
                      </span>
                    </td>
                    <td className="px-4 py-2">${order.total}</td>
                    <td className="px-4 py-2">{order.items} items</td>
                    <td className="px-4 py-2">
                      <span
                        className={`px-2 py-1 rounded-lg text-xs ${
                          order.fulfillment === "Unfulfilled"
                            ? "bg-red-100 text-red-600"
                            : "bg-green-100 text-green-600"
                        }`}
                      >
                        {order.fulfillment}
                      </span>
                    </td>
                    <td className="px-4 py-2 text-center">
                      <button className="text-blue-500 hover:underline">Edit</button>
                      <button className="text-red-500 hover:underline ml-2">Delete</button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
};

export default OrderStock;
